import React from 'react';
import CloseIcon from '@mui/icons-material/Close';
import img from "../profile.webp";
import { Avatar } from '@mui/material';
import InfoIcon from '@mui/icons-material/Info';
import NotificationsNoneOutlinedIcon from '@mui/icons-material/NotificationsNoneOutlined';
import { InfoOutlined } from '@mui/icons-material';

const User = ({name,number,username}) => {
  return (
    <div className='' style={{backgroundColor:'#373A41',color:'white',minWidth:'360px'}}>
        <div className='flex px-3 py-4 justify-between' style={{borderBottom:'1px solid grey'}}>
            <h1 className='text-[20px]'>User Info</h1>
            <CloseIcon/>
        </div>

        <div className='flex items-center gap-8 p-4' style={{borderBottom:'1px solid red'}}>
            <Avatar alt="Profile-Picture" src={img} sx={{height:76,width:76}} />
            {name}
        </div>

        <div className='flex justify-between'  style={{borderBottom:'1px solid red'}}>
                <div className='flex'>
                        <InfoOutlined/>
                        <div>
                        <p className='text-[14px]'>+{number}</p>
                        <p className='text-[10px]'>Mobile</p>
                        </div>

                </div>
                <div className='flex flex-col'>
                        <p className='text-[14px]'>{username}</p>
                        <p className='text-[10px]'>Username</p>
                </div>
        </div>


    </div>
  )
}

export default User
